import { Col, Container, Row } from 'react-bootstrap';
import { Link, useNavigate, useParams } from 'react-router-dom';
import { useAuthr } from '../Login/peticion';



function Profile(){
    const auth=useAuthr();
    const {slug} = useParams();
    const navigate= useNavigate();
    console.log("un profile",auth.user)
    function lectura(e){
        console.log(e.target.outerText)
    }
    
    


    console.log(slug)
    return(
    <Container>
        <Row>
            <Col>
            <ul class="list-group w-50">
            <Link to='../profile/information'> <li onClick={lectura} name="information" class="list-group-item bg-dark text-light active">Information</li></Link>
            <Link to='../profile/change'><li onClick={lectura} class="list-group-item bg-dark text-light" >Change password</li></Link>
            <Link to='../profile/delete'><li onClick={lectura} class="list-group-item bg-dark text-light">Delete courses</li>  </Link>
            <Link to='../profile/drop'><li onClick={lectura} class="list-group-item bg-dark text-light">Drop out</li></Link>
           <li onClick={()=>{auth.logout()}} class="list-group-item bg-dark text-light">Logout</li>
          
            </ul>
            </Col>

            <Col>
            <h2><div id="mainContainer"><div id="leftCol"></div><div id="contentCol" class="clearfix"><div id="headerArea"><div class="uiHeader uiHeaderPage"><div class="clearfix uiHeaderTop"><div class="rfloat _ohf"><h2 class="accessible_elem">Configuración general del perfil</h2><div class="uiHeaderActions"></div></div><div><h2 class="uiHeaderTitle" aria-hidden="true">Configuración general del perfil</h2></div></div></div></div><div id="contentArea" role="main"><div id="SettingsPage_Content"><ul class="uiList fbSettingsList fbSettingsListBorderTop fbSettingsListBorderBottom _4kg _4ks"><li class="fbSettingsListItem clearfix _5b2_ fbSettingsListItemLabeled" data-testid="settings_section_name"><a class="fbSettingsListLink clearfix pvm phs" role="button" aria-expanded="false" aria-labelledby="u_0_0_+y" href="/settings?tab=profile&amp;section=name" rel="ignore" data-meta="{&quot;ajaxify&quot;:&quot;\/ajax\/settings\/account\/name.php&quot;,&quot;rel&quot;:&quot;async&quot;}" data-onclick="[{&quot;mod&quot;:&quot;SettingsController&quot;,&quot;meth&quot;:&quot;handleLinkClick&quot;,&quot;a&quot;:[{&quot;__elem&quot;:1}]}]"><h3 class="pls fbSettingsListItemLabel" id="u_0_0_+y">Nombre</h3><span style="padding-left: 23px;" class="uiIconText fbSettingsListItemEdit"><i class="img sp_IYBUG1HLucU sx_3437ab" style="top: -2px;"></i><span class="fbSettingsListItemEditText">Editar</span></span><span class="fbSettingsListItemSaved hidden_elem">Cambios guardados</span><span class="fbSettingsListItemContent fcg"><strong>Deiby Graciano</strong></span></a><div class="content"></div></li><li class="fbSettingsListItem clearfix _5b2_ fbSettingsListItemLabeled" data-testid="settings_section_username"><a class="fbSettingsListLink clearfix pvm phs" role="button" aria-expanded="false" aria-labelledby="u_0_1_uj" href="/settings?tab=profile&amp;section=username" rel="ignore" data-meta="{&quot;ajaxify&quot;:&quot;\/ajax\/settings\/account\/username.php&quot;,&quot;rel&quot;:&quot;async&quot;}" data-onclick="[{&quot;mod&quot;:&quot;SettingsController&quot;,&quot;meth&quot;:&quot;handleLinkClick&quot;,&quot;a&quot;:[{&quot;__elem&quot;:1}]}]"><h3 class="pls fbSettingsListItemLabel" id="u_0_1_uj">Nombre de usuario</h3><span style="padding-left: 23px;" class="uiIconText fbSettingsListItemEdit"><i class="img sp_IYBUG1HLucU sx_3437ab" style="top: -2px;"></i><span class="fbSettingsListItemEditText">Editar</span></span><span class="fbSettingsListItemSaved hidden_elem">Cambios guardados</span><span class="fbSettingsListItemContent fcg"> https://www.facebook.com/<strong>deiby.graciano</strong></span></a><div class="content"></div></li><li class="fbSettingsListItem clearfix _5b2_ fbSettingsListItemLabeled" data-testid="settings_section_account_management"><a class="fbSettingsListLink clearfix pvm phs" role="button" aria-expanded="false" aria-labelledby="u_0_2_3c" href="/settings?tab=profile&amp;section=account_management" rel="ignore" data-meta="{&quot;ajaxify&quot;:&quot;\/ajax\/settings\/account\/management.php&quot;,&quot;rel&quot;:&quot;async&quot;}" data-onclick="[{&quot;mod&quot;:&quot;SettingsController&quot;,&quot;meth&quot;:&quot;handleLinkClick&quot;,&quot;a&quot;:[{&quot;__elem&quot;:1}]}]"><h3 class="pls fbSettingsListItemLabel" id="u_0_2_3c">Configuración de cuenta conmemorativa</h3><span style="padding-left: 23px;" class="uiIconText fbSettingsListItemEdit"><i class="img sp_IYBUG1HLucU sx_3437ab" style="top: -2px;"></i><span class="fbSettingsListItemEditText">Editar</span></span><span class="fbSettingsListItemSaved hidden_elem">Cambios guardados</span><span class="fbSettingsListItemContent fcg">Decide qué quieres que ocurra con tu perfil principal de Facebook cuando fallezcas.</span></a><div class="content"></div></li></ul></div></div><div id="bottomContent"></div></div></div></h2>
            </Col>
        </Row>
    </Container>
    )
}

export {Profile}
